import React from 'react';
import {WhyChooseUsSection,WhyChooseUsWrapper,WhyChooseUsLeftLayout,WhyChooseUsHeading,WhyChooseUsSingle,
    NumberLayout,NumberText,TextLayout,SubHeading,Content,WhyChooseUsRightLayout,RightImage
} from './whychooseus.style';
import 'bootstrap/dist/css/bootstrap.min.css';
import { WhyChooseUs } from '../../../pagedata/Aboutus1Page';

const WhyChooseUsPage  = () => {
    return (
            <WhyChooseUsSection>
                <WhyChooseUsWrapper>
                    <WhyChooseUsLeftLayout>
                        <WhyChooseUsHeading>
                        {WhyChooseUs.WhyChooseUsHeading}
                        </WhyChooseUsHeading>
                        <WhyChooseUsSingle>
                            <NumberLayout BeforeReq>
                                <NumberText>
                                {WhyChooseUs.Details[0].NumberLayout}
                                </NumberText>
                            </NumberLayout>
                            <TextLayout>
                                <SubHeading>
                                {WhyChooseUs.Details[0].SubHeading}
                                </SubHeading>
                                <Content>
                                {WhyChooseUs.Details[0].Content}
                                </Content>
                            </TextLayout>
                        </WhyChooseUsSingle>
                        <WhyChooseUsSingle>
                            <NumberLayout BeforeReq>
                                <NumberText>
                                {WhyChooseUs.Details[1].NumberLayout}
                                </NumberText>
                            </NumberLayout>
                            <TextLayout>
                                <SubHeading>
                                {WhyChooseUs.Details[1].SubHeading}
                                </SubHeading>
                                <Content>
                                {WhyChooseUs.Details[1].Content}
                                </Content>
                            </TextLayout>
                        </WhyChooseUsSingle>
                        <WhyChooseUsSingle>
                            <NumberLayout>
                                <NumberText>
                                {WhyChooseUs.Details[2].NumberLayout}
                                </NumberText>
                            </NumberLayout>
                            <TextLayout>
                                <SubHeading>
                                {WhyChooseUs.Details[2].SubHeading}
                                </SubHeading>
                                <Content>
                                {WhyChooseUs.Details[2].Content}
                                </Content>
                            </TextLayout>
                        </WhyChooseUsSingle>
                    </WhyChooseUsLeftLayout>
                    <WhyChooseUsRightLayout>
                        <RightImage 
                            src={require("../../../assets/"+WhyChooseUs.RightImage)} 
                            alt=""
                        />
                    </WhyChooseUsRightLayout>
                </WhyChooseUsWrapper>
            </WhyChooseUsSection>
    );
}
export default WhyChooseUsPage;
